import { useState } from "react";
import { NavLink, Outlet } from "react-router-dom";
import Table from "../Table";
import ProductBox from "./ProductBox";

import "./products.css";
import Step from "./Step";

const Products = () => {
  const [displayFormat, getDisplayFormat] = useState("bar");

  const [showStep, getShowStep] = useState(true);

  const headerTitle = [
    {
      id: 1,
      title: "المنتج",
    },
    {
      id: 2,
      title: "الاسم",
