      {
        id: 7,
        title: <span>مغلق</span>,
        state: false,
      },
      {
        id: 8,
        title: (
          <div onClick={changeShowStep}>
            <i className="fa-solid fa-ellipsis-vertical"></i>
            {showStep && (
              <div>
                <span>
                  <i className="fa-regular fa-eye"></i>
